import React from "react";

const CreateNote = () => {
    return (
        <>
        <div className="main_note">
            <form>
                <input type="text" placeholder="Title" className="input"/>
                <textarea rows="" column="" placeholder="Write a not..." className="input"></textarea>
                <button>+</button>
            </form>
        </div>
        </>
    );
};
export default CreateNote;
